import React from "react";
import { Route, useParams } from "react-router-dom";

import Comments from "../components/Comments/Comments";

const QuoteDetail = () => {
  const { id } = useParams();

  return (
    <div>
      <h1>{id}</h1>
      <Route to="/quotes/:id/comments" component={Comments} />
    </div>
  );
};

export default QuoteDetail;
